import { Container, Stack } from '@mui/material';
// import CardItem from '../../component/CardItem/CardItem';

// import { videoBasic } from '../../API/basic';

function Subrice() {
    return (
        <Container>
            <Stack direction="row" gap={2} mt="12px">
                hiihi
            </Stack>
        </Container>
    );
}

export default Subrice;
